<p>
    ExtRamp Online is a website that enables users to quickly calculate ramp sequences in small fasta files. Users can also download
    CSV files that contain the data about the prevalence of ramp sequences in genes of diffrent tissue and cell types. Enjoy!
</p>

<br />
<hr style=""width:100%;text-align:center;height: 2px;"" />

<h3>What is a Ramp Sequence?</h3>
<p>
    A ramp sequence is a segment of slowly translated codons at the beginning of a gene. This altered initiation of translation,
    causes the ribosomes to space out to prevent ribosome collisions downstream in translation. The graph below shows the
    translational efficiency (measured as a Relative Synonymous Codon Usage, or RSCU, value) of codons throughout the gene. The orange segment is the ramp sequence which has a mean
    translational efficiency of 0.4531, while the entire gene has a mean efficiency of 0.7734. A translational efficiecny of 1.0 would be the most rapidly translated.
</p>
